sys_variable_value.value:
(function execute(inputs, outputs) {
	var issuesOut = [];
	var inputs2 = {};

	inputs2['connection_alias'] = inputs.alias; // GlideRecord of table: sys_alias 
	inputs2['jql'] = inputs.query; // String 
	inputs2['start_at'] = 0; // Integer 
	inputs2['max_records'] = 50; // Integer 



	var outputs2 = sn_fd.FlowAPI.executeAction(
		'sn_jira_spoke.look_up_records_by_jql__no_max', inputs2);


	var number_of_records = outputs2['variable']; // number of records
	var issues = outputs2['variable1'].issues; // Issues
	var status = outputs2['variable12']; // status
	var error = outputs2['variable3']; // Error Message
	var end = outputs2['end']; // Integer

	outputs.totalcount = number_of_records;


	outputs.allissues = {};
	outputs.allissues.iss = [];
	var i = 0;

	for (var i = 0; i < issues.length; i++) {
		outputs.allissues.iss[i] = issues[i];
	}


	var pages = number_of_records / 50;
	var end2 = end;
	if (status == "Success") {
		for (var j = 1; j < pages && end2 != -1; j++) {


			var inputs2 = {};
			inputs2['connection_alias'] = inputs.alias; // GlideRecord of table: sys_alias 
			inputs2['jql'] = inputs.query; // String 
			inputs2['start_at'] = end2; // Integer 
			inputs2['max_records'] = 50; // Integer 

			var outputs3 = sn_fd.FlowAPI.executeAction(
				'sn_jira_spoke.look_up_records_by_jql__no_max', inputs2);



			var issues2 = outputs3['variable1'].issues; // Issues
			status = outputs3['variable12']; // status
			error = outputs3['variable3']; // Error Message
			end2 = outputs3['end']; // Integer

			for (var l = 0; l < issues2.length; l++) {
				outputs.allissues.iss[i] = issues2[l];
				i++;
			}

		}
	} else {
		outputs.status = "Error";
		outputs.error = error;
	}




})(inputs, outputs);

